import "./UserCard.css";

const UserCard = ({ userInfo }) => {
  return (
    <div className="user-card">
      <img src="#" className="user-card__img" />
      <div className="user-card__name">{userInfo.name}</div>
      <div className="user-card__age">{userInfo.name}</div>
      <div className="user-card__gender">{userInfo.name}</div>
      <div className="user-card__balance">{userInfo.name}</div>
    </div>
  );
};

export default UserCard;
